import React from 'react';
import HomePage from './components/HomePage';
import { AppLoading } from 'expo';
import Navigator from './routes/homeStack'




const App = () => {

  if(fontsLoaded){
    return (
      <Navigator />
    );
  } else {
    return (
      <>
      <AppLoading 
      startAsyns={getFonts}
      onFinish={() => setFontsLoaded(true)}
      />
      <HomePage />
      </>
    )
  }


}

export default App;
